В Україні зафіксовано 1658 нових випадків коронавірусної хвороби COVID-19.

25 серпня (станом на 9:00) в Україні 108 415 лабораторно підтверджених випадків COVID-19, з них 2318 летальних, 52 870 пацієнтів одужали. За добу зафіксовано 1658 нових випадків. Загалом проведено 
1 436 206 тестувань методом ПЛР. Усього за добу одужало 346 пацієнтів. 

